import React, { Component } from 'react';
import './FunContainer.css';

class FunContainer extends Component {
  render() {
    return (
      <div className='fun-container'>
        <h1>Fun Container</h1>
        <p>Fun goes here</p>
      </div>
    );
  }
}

export default FunContainer;
